import React, { useEffect, useState } from "react";
import { Link as ScrollLink } from "react-scroll";
import { Link as RouterLink, useLocation } from "react-router-dom";
import { FaBars, FaTimes } from "react-icons/fa";
import LogoRids from "../assets/LOGO_RIDS_blanco.png";

export default function Header() {
  const [scrolled, setScrolled] = useState(false);
  const [menuOpen, setMenuOpen] = useState(false);
  const location = useLocation();

  useEffect(() => {
    const handleScroll = () => setScrolled(window.scrollY > 20);
    window.addEventListener("scroll", handleScroll);
    return () => window.removeEventListener("scroll", handleScroll);
  }, []);

  const handleLinkClick = () => setMenuOpen(false);

  return (
    <header
      className={`fixed top-0 left-0 w-full z-50 transition-all duration-300 ${
        scrolled ? "bg-[#072b3a]/95 shadow-md backdrop-blur" : "bg-transparent"
      }`}
    >
      <div className="max-w-7xl mx-auto flex justify-between items-center px-6 py-4">
        {/* üü¶ Logo */}
        <RouterLink to="/" className="flex items-center space-x-3">
          <img src={LogoRids} alt="Logo RIDS" className="h-10 w-auto" />
        </RouterLink>

        {/* üß≠ Desktop Navigation */}
        <nav className="hidden md:flex space-x-8 text-white font-medium">
          {location.pathname === "/" ? (
            <>
              <ScrollLink
                to="hero"
                smooth={true}
                duration={700}
                offset={-70}
                className="hover:text-[#00AEEF] transition cursor-pointer"
              >
                Inicio
              </ScrollLink>
              <RouterLink to="/sobrenosotros" className="hover:text-[#00AEEF] transition">
                Sobre Nosotros
              </RouterLink>
              <RouterLink to="/servicios1" className="hover:text-[#00AEEF] transition">
                Servicios
              </RouterLink>
              <RouterLink to="/planes" className="hover:text-[#00AEEF] transition">
                Planes
              </RouterLink>
            </>
          ) : (
            <>
              <RouterLink to="/" className="hover:text-[#00AEEF] transition">
                Inicio
              </RouterLink>
              <RouterLink to="/sobrenosotros" className="hover:text-[#00AEEF] transition">
                Sobre Nosotros
              </RouterLink>
              <RouterLink to="/servicios1" className="hover:text-[#00AEEF] transition">
                Servicios
              </RouterLink>
              <RouterLink to="/planes" className="hover:text-[#00AEEF] transition">
                Planes
              </RouterLink>
            </>
          )}
        </nav>

        {/* üçî Hamburguesa (Mobile) */}
        <div className="md:hidden">
          <button onClick={() => setMenuOpen(!menuOpen)} className="text-white text-2xl">
            {menuOpen ? <FaTimes /> : <FaBars />}
          </button>
        </div>
      </div>

      {/* üì± Mobile Menu */}
      <div
        className={`md:hidden fixed top-0 right-0 w-3/4 h-full bg-[#072b3a] text-white flex flex-col items-center justify-center space-y-8 text-lg font-medium transition-transform duration-300 ${
          menuOpen ? "translate-x-0" : "translate-x-full"
        }`}
      >
        {location.pathname === "/" ? (
          <>
            <ScrollLink
              to="hero"
              smooth={true}
              duration={700}
              offset={-70}
              onClick={handleLinkClick}
              className="hover:text-[#00AEEF] cursor-pointer"
            >
              Inicio
            </ScrollLink>
            <RouterLink to="/sobrenosotros" onClick={handleLinkClick} className="hover:text-[#00AEEF]">
              Sobre Nosotros
            </RouterLink>
            <RouterLink to="/servicios1" onClick={handleLinkClick} className="hover:text-[#00AEEF]">
              Servicios
            </RouterLink>
            <RouterLink to="/planes" onClick={handleLinkClick} className="hover:text-[#00AEEF]">
              Planes
            </RouterLink>
          </>
        ) : (
          <>
            <RouterLink to="/" onClick={handleLinkClick} className="hover:text-[#00AEEF]">
              Inicio
            </RouterLink>
            <RouterLink to="/sobrenosotros" onClick={handleLinkClick} className="hover:text-[#00AEEF]">
              Sobre Nosotros
            </RouterLink>
            <RouterLink to="/servicios1" onClick={handleLinkClick} className="hover:text-[#00AEEF]">
              Servicios
            </RouterLink>
            <RouterLink to="/planes" onClick={handleLinkClick} className="hover:text-[#00AEEF]">
              Planes
            </RouterLink>
          </>
        )}
      </div>
    </header>
  );
}
